import "../style/navbar.css"

class Navbar extends React.Component {
    render() {
        return (
            <div className ="container">
                <div className ="button">
                    <div className ="btn">
                        This is a button.
                    </div>
                </div>
            </div>
        )
    }
}

export default Navbar;
